import React, { Component } from 'react'

export default class Fetchme extends Component {
    constructor(props) {
        super(props);
        this.state = {
          data: null,
        };
    }
    componentDidMount() {
        fetch('https://www.redbus.in/Home/SolarSearch?search=c&parentLocationId=14&parentId=123&parentLocationType=CITY')
          .then(response => response.json())
          .then(parsedJSON)
          .then(data => this.setState({ data }));
      }

    render() {
        const { hits } = this.state;

        return (
            <ul>
        {hits.map(hit =>
          <li key={hit.objectID}>
            <a href={hit.url}>{hit.title}</a>
          </li>
        )}
      </ul>
        );
    }
}
